आज डिजिटल रूबिक्स क्यूब पर खेलने का अभ्यास करें। {{}

रूबिक्स क्यूब में बेहतर होना चाहते हैं? फिजिकल कॉपी खरीदने से पहले आज ही डिजिटल वर्जन पर खेलें। {२}

इस खेल का लक्ष्य क्यूब के सभी रंगों को एक साथ सही ढंग से संरेखित करना है। यह एक सरल और मजेदार खेल है
आपके मस्तिष्क और मानसिक कौशल का परीक्षण करेगा। आज इस रूबिक्स क्यूब का उपयोग करने का प्रयास करें। {{}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। Google Chrome के लिए Rubiks Cube के स्वामित्व में नहीं है, इसके पास लाइसेंस नहीं है और यह Google Inc. की सहायक कंपनी नहीं है।
